  false,\n\t\"url\": null,\n\t\"notes\": \"The attached files include a paper as well
  as spreadsheets that allow input of water and gas analytes to produce ternary diagrams
  and other Excel graphics to create a geothermomerty report. Citation: Powell, Tom
  and Cumming, William 2010. Spreadsheets for Geothermal Water and Gas Geochemistry.
  Thirty-Fifth Workshop on Geothermal Reservoir EngineeringnStanford University, Stanford,
  California, February 1-3, 2010. SGP-TR-188 (https://pangea.stanford.edu/ERE/pdf/IGAstandard/SGW/2010/powell.pdf).nSpecific
  analyte suites in AASG Geothermal Project Powell and Cummings Geothermometry content
  model and services have been tailored for use in this analysis. See a specific dataset
  for the desired inputs. nTo create a service, see http://www.stategeothermaldata.org/data_delivery/content_models/powell_cummings_geothermometry.
  nFor further information on Stanford University's Geothermal Program, see https://pangea.stanford.edu/researchgroups/geothermal/.
